import React from 'react';

const Istrue = (props) => {
    return (
        <>
            <div className='slot_inner'>
                <h1>
                    {props.x} {props.y} {props.z}
                </h1>
                <h1>This is matching.</h1>
                <hr />
            </div>
        </>
    )
}

export default Istrue;
